3.body:
A smallweb app can be as simple as a single module, exporting a single function. This function will be called with the request object, and should return a response object. By default, smallweb will look for a module called http.[js,ts,tsx,jsx] in the root of the app. // basic/http.ts
export default function(req: Request): Response { const url = new URL(req.url); const name = url.searchParams.get("name") || "world"; return new Response(`Hello, ${name}!`);
} To run serve this app, you use the smallweb CLI: smallweb basic tutorial

5.body:
Of course, most apps will need more advanced routing. Smallweb integrates well with modern routing libraries like hono . import { Hono } from "jsr:@hono/hono"; const app = new Hono(); app.get("/", (c) => { return c.json({ message: "Hello, world!" });
}); app.get("/:name", (c) => { const { name } = c.param(); return c.json({ message: `Hello, ${name}!` });
}); export default app.fetch; No need to run a run an install command, deno will automatically fetch the dependencies when you run the app. Just use smallweb serve hono to start the server.

