Smallweb also supports JSX, which allows you to write HTML in your JavaScript files. // jsx/hello.tsx // this line defines which variant of JSX to use
/** @jsxImportSource https://esm.sh/preact */ import { render } from "https://esm.sh/preact-render-to-string"; export default function(req) { const url = new URL(req.url); const name = url.searchParams.get("name") || "world"; return new Response(render(<h1>Hello, {name}!</h1>), { headers: { "Content-Type": "text/html" }, });
}
